import React from 'react';
import {Link} from 'react-router-dom';

const items = [
    {
        label : "Home",
        to : "/home",
    },
    {
        label : "Appoinments",
        to : "/appoinments",
    },
    {
        label : "Remote Check-Up",
        to : "/checkup",
    }
  ]


const Navbar = () => {

  return (
    <div>
        <section className='h-36 w-full'>
            <section className='h-32 bg-custombg mt-4 ml-4 mr-4 rounded-2xl flex flex-1 justify- items-center'>
            
                <div className="">
                    <ul className="flex items-center justify-evenly gap-20 pr-40 text-white text-2xl">
                        {
                            items.map((item , key) => (
                                <li key={key}>
                                    <Link to={item.to}>
                                        {item.label}   
                                    </Link>
                                </li>
                            ))
                        }
                    </ul>
            </div>
            </section>
        </section>
    </div>
  )
}

export default Navbar
